import React, { Component } from 'react';
import Head from './Head';
import Header from './Header';
import SocialLinks from './Social';
import { MainStyles } from '../styles';

class Layout extends Component {
  state = {
    meta: {
      title: 'Brady Fox | A Marketer That Can Code',
      siteDescription:
        'A driven digital marketing leader with a growing record of delivering measurable impact for clients across multiple industries.',
      siteUrl: 'https://bradycfox.com'
    }
  };

  finishLoading = () => this.setState({ isLoading: false });

  render() {
    const { children } = this.props;
    return (
      <div>
        <Head metadata={this.props.meta} />
        <MainStyles />
          <div>
          <Header />}
            <SocialLinks />
            {children}
          </div>
      </div>
    );
  }
}

export default Layout;
